/*Table structure for table `portfolios` */

DROP TABLE IF EXISTS `portfolios`;

CREATE TABLE `portfolios` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `sponsee_id` bigint(20) DEFAULT NULL,
  `category_id` bigint(20) DEFAULT NULL,
  `description` text,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=latin1;

/*Data for the table `portfolios` */

insert  into `portfolios`(`id`,`sponsee_id`,`category_id`,`description`) values (1,2,1,'This is a sample description or summary about this category.'),(4,1,1,'This is a sample description or summary about this category.'),(2,2,2,'This is a sample description or summary about this category.'),(3,1,2,'This is a sample description or summary about this category.');

/*Table structure for table `sponsee_images` */

DROP TABLE IF EXISTS `sponsee_images`;

CREATE TABLE `sponsee_images` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `sponsee_id` bigint(20) DEFAULT NULL,
  `description` varchar(100) DEFAULT NULL,
  `date_uploaded` datetime DEFAULT NULL,
  `image` blob,
  `content_type` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`)
